import Todos from "./\bcomponents/Todos";
import Todo from "./models/todo";

function App() {

  const todos = [
    new Todo('Learn React'),
    new Todo('Learn TypeScript'),
    new Todo('Do Project'),
  ];
  return (
    <div>
      <Todos items={['Learn React', 'Learn TypeScript', 'Do Project']}/>
    </div>
  );
}

export default App;
